import '../styles/Promotions.css';

const Promotions = () => {
  return (
    <div className="promotions">
      <div className="promotion-item">
        <h3 className="promotion-title">Seasonal Sale - Up to 50% OFF!</h3>
        <button className="promotion-btn">Shop Now</button>
      </div>
      <div className="promotion-item">
        <h3 className="promotion-title">Buy 1 Get 1 Free on Select Items</h3>
        <button className="promotion-btn">Shop Now</button>
      </div>
      <div className="promotion-item">
        <h3 className="promotion-title">Exclusive Member Discounts</h3>
        <button className="promotion-btn">Join Now</button>
      </div>
    </div>
  );
};

export default Promotions;
